import s from './bookElem.module.css'

const BookElem = (props) =>{
  return (
    <div className={s.bookElem}>
      <div className={s.bookCover}><img src={props.photo} /></div>
      <div className={s.details}>{props.details}</div>
      <div className={s.rating}>{props.rating}</div>
    </div>
  )
}

export default BookElem;
